import React from 'react';
import miniProfile from './components/miniProfile';
import './App.css';



function App(props) {
  const [players, setPlayers] = useState(props.players);
  const playerList = players.map((player) => (
    <miniProfile
      id={player.id}
      name={player.name}
      PPG={player.PPG}
    />
  ));
  return (
    <div className="1">
      <h1>Players</h1>
      <ul
        className="2"
        aria-labelledby="list-heading"
      >
        {playerList}
      </ul>
    </div>
  );
}

export default App;
